	@Inject
	public RecordLangGrammarAccess(GrammarProvider grammarProvider,
		TerminalsGrammarAccess gaTerminals) {
		this.grammar = internalFindGrammar(grammarProvider);
		this.gaTerminals = gaTerminals;
		this.pModel = new ModelElements();
		this.pImport = new ImportElements();
		this.pType = new TypeElements();
		this.pBaseType = new BaseTypeElements();
		this.pComplexType = new ComplexTypeElements();
		this.pTemplateType = new TemplateTypeElements();
		this.pRecordType = new RecordTypeElements();
		this.pConstant = new ConstantElements();
		this.pProperty = new PropertyElements();
		this.pForeignKey = new ForeignKeyElements();
		this.ePropertyModifier = new PropertyModifierElements();
		this.pClassifier = new ClassifierElements();
		this.pArraySize = new ArraySizeElements();
		this.pLiteral = new LiteralElements();
		this.pArrayLiteral = new ArrayLiteralElements();
		this.pStringLiteral = new StringLiteralElements();
		this.pIntLiteral = new IntLiteralElements();
		this.pFloatLiteral = new FloatLiteralElements();
		this.pBooleanLiteral = new BooleanLiteralElements();
		this.pConstantLiteral = new ConstantLiteralElements();
		this.pBuiltInValueLiteral = new BuiltInValueLiteralElements();
		this.pQualifiedName = new QualifiedNameElements();
		this.pQualifiedNameWithWildcard = new QualifiedNameWithWildcardElements();
		this.tNUMBER = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "kieker.tools.rl.RecordLang.NUMBER");
		this.tINT = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "kieker.tools.rl.RecordLang.INT");
		this.tFLOAT = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "kieker.tools.rl.RecordLang.FLOAT");
		this.tBOOLEAN = (TerminalRule) GrammarUtil.findRuleForName(getGrammar(), "kieker.tools.rl.RecordLang.BOOLEAN");
	}
	
	protected Grammar internalFindGrammar(GrammarProvider grammarProvider) {
		Grammar grammar = grammarProvider.getGrammar(this);
		while (grammar != null) {
			if ("kieker.tools.rl.RecordLang".equals(grammar.getName())) {
				return grammar;
			}
			List<Grammar> grammars = grammar.getUsedGrammars();
			if (!grammars.isEmpty()) {
				grammar = grammars.iterator().next();
			} else {
				return null;
			}
		}
		return grammar;
	}
	
	@Override
	public Grammar getGrammar() {
		return grammar;
	}
	

